import "./App.css";
import React from "react";
import Header from "./components/header/Header";
import Page from "./Page";
import Footer from "./components/footer/footer";

function App() {
  return (
    <React.Fragment>
      <Header />
      <Page />
      <Footer />
    </React.Fragment>
  );
}

export default App;
